class CNNBlock(nn.Module):
  def __init__(self, in_channels, out_channels,kernal_size, stride, padding, **kwargs):
    super(CNNBlock, self).__init__()
    #they used leaky relu instead of RElu and they didn't use batch mormalization
    #it was not invented at the time of YOLO#1
    #we will try to include it because it is really easy to do so...
    #bias= False because we will use batch normalization
    self.conv= nn.Conv2d(in_channels, out_channels,kernal_size=kernal_size , bias = False, stride= stride, padding=padding,**kwargs)
    self.batchnorm= nn.Batchnorm2d(out_channels)
    self.leakyrelu= nn.LeakyReLU(0.1) #0.1 is the slope

  #the forward function
  def forward(self, x):
    return self.leakyrelu(self.batchnorm(self.conv(x)))

