import torch
import torch.nn as nn

""" 
Information about architecture config:
Tuple is structured by (kernel_size, filters, stride, padding) 
"M" is simply maxpooling with stride 2x2 and kernel 2x2
List is structured by tuples and lastly int with number of repeats
"""

architecture_config = [
    (7, 64, 2, 3),
    "M",
    (3, 192, 1, 1),
    "M",
    (1, 128, 1, 0),
    (3, 256, 1, 1),
    (1, 256, 1, 0),
    (3, 512, 1, 1),
    "M",
    [(1, 256, 1, 0), (3, 512, 1, 1), 4],
    (1, 512, 1, 0),
    (3, 1024, 1, 1),
    "M",
    [(1, 512, 1, 0), (3, 1024, 1, 1), 2],
    (3, 1024, 1, 1),
    (3, 1024, 2, 1),
    (3, 1024, 1, 1),
    (3, 1024, 1, 1),
]


class CNNBlock(nn.Module):
    def __init__(self, in_channels, out_channels, **kwargs):
        super(CNNBlock, self).__init__()
        self.conv = nn.Conv2d(in_channels, out_channels, bias=False, **kwargs)
        self.batchnorm = nn.BatchNorm2d(out_channels)
        self.leakyrelu = nn.LeakyReLU(0.1)

    def forward(self, x):
        return self.leakyrelu(self.batchnorm(self.conv(x)))


class Yolov1(nn.Module):
    def __init__(self, in_channels=3, **kwargs):
        super(Yolov1, self).__init__()
        self.architecture = architecture_config
        self.in_channels = in_channels
        self.darknet = self._create_conv_layers(self.architecture)
        self.fcs = self._create_fcs(**kwargs)

    def forward(self, x):
        x = self.darknet(x)
        return self.fcs(torch.flatten(x, start_dim=1))

    def _create_conv_layers(self, architecture):
        layers = []
        in_channels = self.in_channels

        for x in architecture:
            if type(x) == tuple:
                layers += [
                    CNNBlock(
                        in_channels, x[1], kernel_size=x[0], stride=x[2], padding=x[3],
                    )
                ]
                in_channels = x[1]

            elif type(x) == str:
                layers += [nn.MaxPool2d(kernel_size=(2, 2), stride=(2, 2))]

            elif type(x) == list:
                conv1 = x[0]
                conv2 = x[1]
                num_repeats = x[2]

                for _ in range(num_repeats):
                    layers += [
                        CNNBlock(
                            in_channels,
                            conv1[1],
                            kernel_size=conv1[0],
                            stride=conv1[2],
                            padding=conv1[3],
                        )
                    ]
                    layers += [
                        CNNBlock(
                            conv1[1],
                            conv2[1],
                            kernel_size=conv2[0],
                            stride=conv2[2],
                            padding=conv2[3],
                        )
                    ]
                    in_channels = conv2[1]

        return nn.Sequential(*layers)

    def _create_fcs(self, split_size, num_boxes, num_classes):
        S, B, C = split_size, num_boxes, num_classes

        # In original paper this should be
        # nn.Linear(1024*S*S, 4096),
        # nn.LeakyReLU(0.1),
        # nn.Linear(4096, S*S*(B*5+C))

        return nn.Sequential(
            nn.Flatten(),
            nn.Linear(1024 * S * S, 496),
            nn.Dropout(0.0),
            nn.LeakyReLU(0.1),
            nn.Linear(496, S * S * (C + B * 5)),
        )

"""the loss function for the yolo algorithm.

![image.png](data:image/png;base64,)

first two parts are to describe the bounding box coordinates, the position of (x,y) the mid point, and the width anfd hieght of the bounding box...

all of the parts of the loss function is a form of squared error, we will take the predictions of the mid valus, and there is an identity function, which equals to one only:
if there is an object in the square/cell i and i goes from 0 to S squared so it goes over the whole grid... additionaly that the boundig box j is the one reponsable for outputting that bunfing box.

how do we know which cell is responsible for outputting that bounding box?
we have to look at a cell, and check which bounding box "in this work we will output two bounding boxs" has the highest IOU with the target bounding box. /the one that has the highest IOU with the target bounding box is the one responsible for the prediction/
lamda coord is a a constant for example 5 just to make this element bigger.

the second part is for the width it is simillar to the first element, the only difference is the square roots: 
the reason behind that is if we have large bounding boxes this element will be bigger, and small bounding boxes will make this element smaller,so taking the sqrt will make sure that we proritize the small bounding boex equally at the same rate that we priotrize the larger bounding boxes.

**the third part: IF there is an object in the cell** is for the loss function in c, if we remember c is related to the probability wether this cell has a bounding box, also the same entity function "the one with the highest IOU", we also go throught each cell and every bounding box outputed in that cell.

**the fourth part: IF there is NO object in the cell** unclear exactly maybe the one with the lwest IOU... they also multiply by lambda no object, which is small condtant, because they don't want to priotrize this element as much.

the last element is for the classes to make sure that we actually can say which class does this object belonge to. So, for each cell, we check is there anobject here!!! then for each class we take the sum squared error...

Normally here we can do cross entropy loss, or negative log likelyhood... but here they used a regression based loss
"""

